script: |
  super -f text -I q2825.spq | sort > q2825.out

inputs:
  - name: q2825.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 / col1 NOT IN ( + - CAST ( NULL AS INTEGER ), - col2, col0, + + col2 * - 4, + 9 );
  - name: tab0

outputs:
  - name: q2825.out
    data: |
      97	1	99
